import React, { useState, useEffect } from 'react';
import { Container, Row, Col, Card, Button, Alert, ListGroup } from 'react-bootstrap';
import { Link } from 'react-router-dom';
import HabitForm from './HabitForm';
import { fetchHabits, createHabit, getUserData, getHabitStatistics } from '../services/api';
import { Chart } from "react-google-charts";

function Dashboard() {
  const [habits, setHabits] = useState([]);
  const [showForm, setShowForm] = useState(false);
  const [error, setError] = useState(null);
  const [userName, setUserName] = useState('');
  const [statistics, setStatistics] = useState({ today: 0, week: 0, month: 0 });

  useEffect(() => {
    loadHabits();
    fetchUserName();
    fetchStatistics();
  }, []);

  const loadHabits = async () => {
    try {
      const data = await fetchHabits();
      setHabits(data);
      setError(null);
    } catch (error) {
      console.error('Error loading habits:', error);
      setError('Failed to load habits. Please try again.');
    }
  };

  const fetchUserName = async () => {
    try {
      const userData = await getUserData();
      setUserName(userData.name);
    } catch (error) {
      console.error('Error fetching user data:', error);
    }
  };

  const fetchStatistics = async () => {
    try {
      const stats = await getHabitStatistics();
      setStatistics(stats);
    } catch (error) {
      console.error('Error fetching habit statistics:', error);
    }
  };

  const handleCreateHabit = async (habitData) => {
    try {
      await createHabit(habitData);
      setShowForm(false);
      loadHabits();
      fetchStatistics();
      setError(null);
    } catch (error) {
      console.error('Error creating habit:', error);
      setError('Failed to create habit. Please try again.');
    }
  };

  const chartData = [
    ['Habit', 'Completion Rate'],
    ...habits.map(habit => [habit.name, habit.completionRate || 0])
  ];

  return (
    <Container>
      <h1 className="my-4">Welcome, {userName}!</h1>
      {error && <Alert variant="danger">{error}</Alert>}
      <Row className="mb-4">
        <Col md={4}>
          <Card className="h-100">
            <Card.Body>
              <Card.Title>Today's Progress</Card.Title>
              <Card.Text className="display-4">{statistics.today}%</Card.Text>
              <Card.Text>of habits completed</Card.Text>
            </Card.Body>
          </Card>
        </Col>
        <Col md={4}>
          <Card className="h-100">
            <Card.Body>
              <Card.Title>This Week</Card.Title>
              <Card.Text className="display-4">{statistics.week}%</Card.Text>
              <Card.Text>of habits completed</Card.Text>
            </Card.Body>
          </Card>
        </Col>
        <Col md={4}>
          <Card className="h-100">
            <Card.Body>
              <Card.Title>This Month</Card.Title>
              <Card.Text className="display-4">{statistics.month}%</Card.Text>
              <Card.Text>of habits completed</Card.Text>
            </Card.Body>
          </Card>
        </Col>
      </Row>
      <Row>
        <Col md={8}>
          <h2>Your Habits</h2>
          <ListGroup>
            {habits.map(habit => (
              <ListGroup.Item key={habit.id} className="d-flex justify-content-between align-items-center">
                <span>{habit.name}</span>
                <div>
                  <Button variant="outline-primary" size="sm" className="mr-2" as={Link} to={`/habit/${habit.id}`}>
                    View Details
                  </Button>
                  <Button variant="outline-success" size="sm">Mark Complete</Button>
                </div>
              </ListGroup.Item>
            ))}
          </ListGroup>
          <Button onClick={() => setShowForm(!showForm)} className="mt-3">
            {showForm ? 'Cancel' : 'Add New Habit'}
          </Button>
          {showForm && <HabitForm onSubmit={handleCreateHabit} />}
        </Col>
        <Col md={4}>
          <Card>
            <Card.Body>
              <Card.Title>Habit Completion Rates</Card.Title>
              <Chart
                width={'100%'}
                height={'300px'}
                chartType="PieChart"
                loader={<div>Loading Chart</div>}
                data={chartData}
                options={{
                  title: 'Habit Completion Rates',
                  is3D: true,
                }}
              />
            </Card.Body>
          </Card>
        </Col>
      </Row>
    </Container>
  );
}

export default Dashboard;
